    public function contar($em)
    {
        $repository = $em->getRepository(Becado::class);

        $contador = $repository->createQueryBuilder('u')
            ->select('count(u.id)')
            ->where('u.vigencia = :year')
            ->setParameter('year', Parametros::YEAR)
            ->getQuery()
            ->getSingleScalarResult();

        return $contador;
    }

    /**
     * @Route("/findbyidinstitucion/{idinstitucion}/{token}", name="becadobyidinstitucion_findall")
     */
    public function findbyidinstitucion($idinstitucion, $token)
    {
        $realizoActualizacion = FALSE;
        $helpers = $this->get("app.helpers");
        $check = $helpers->authCheck($token, true);

        if ($check == FALSE) {
            return new JsonResponse(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "Token no es valido"
            ));
        }

        $em = $this->getDoctrine()->getManager();

        $reqs = $em->getRepository(Requerimiento::class)
            ->findBy(array(), array('orden' => 'ASC'));

        $l = $em->getRepository(Becado::class)
            ->findBy(['institucion' => $idinstitucion, "vigencia" => Parametros::YEAR]);

        foreach ($l as $becado) {

            foreach ($reqs as $requerimiento) {

                $d = $em->getRepository(Documentopresentado::class)
                    ->findOneBy([
                        "idbecado" => $becado->getId(),
                        "requerimiento" => $requerimiento
                    ]);
                if (!is_object($d)) {

                    $documentopresentado = new Documentopresentado();

                    $documentopresentado->setIdbecado($becado->getId());
                    $documentopresentado->setRequerimiento($requerimiento);
                    $documentopresentado->setRevisado("N");

                    $em->persist($documentopresentado);
                    $realizoActualizacion = TRUE;
                }
            }

            if ($realizoActualizacion) {
                $em->flush();
            }

            $dp = $em->getRepository(Documentopresentado::class)
                ->findBy(["idbecado" => $becado]);
            $becado->setDocumentospresentados($dp);
        }

        return $helpers->json($l);
    }

    /**
     * @Route("/findpostulados/{mocodmotiv}/{vigencia}", name="postuladomotivo_findall")
     */
    public function findpostulados($mocodmotiv, $vigencia)
    {
        $helpers = $this->get("app.helpers");
        $em = $this->getDoctrine()->getManager();

        if ($mocodmotiv == '00') {
            $l = $em->getRepository(Becado::class)
                ->findBy(
                    array('vigencia' => $vigencia),
                    array('consecutivo' => 'ASC')
                );
        } else {
            $l = $em->getRepository(Becado::class)
                ->findBy(
                    array('mocodmotiv' => $mocodmotiv, 'vigencia' => $vigencia),
                    array('consecutivo' => 'ASC')
                );
        }

        foreach ($l as $becado) {
            $dp = $em->getRepository(Documentopresentado::class)
                ->findBy(["idbecado" => $becado]);
            $becado->setDocumentospresentados($dp);
        }

        return $helpers->json($l);
    }

    public function inicializarEntidadDesdeJSON($json, $t)
    {
        $params = json_decode($json);

        foreach ($params as $k => $valor) {
            switch (strtolower($k)) {
                case "id":
                    //No se actualiza este campo
                    break;
                case "tipodocumento":
                    $t->setTipodocumento($valor);
                    break;
                case "numerodocumento":
                    $t->setNumerodocumento($valor);
                    break;
                case "primerapellido":
                    $t->setPrimerapellido($valor);
                    break;
                case "segundoapellido":
                    $t->setSegundoapellido($valor);
                    break;
                case "primernombre":
                    $t->setPrimernombre($valor);
                    break;
                case "segundonombre";
                    $t->setSegundonombre($valor);
                    break;
                case "correoelectronico":
                    $t->setCorreoelectronico($valor);
                    break;
                case "telefonofijo":
                    $t->setTelefonofijo($valor);
                    break;
                case "telefonomovil":
                    $t->setTelefonomovil($valor);
                    break;
                case "genero":
                    $t->setGenero($valor);
                    break;
                case "codigociudad":
                    $t->setCodigociudad($valor);
                    break;
                case "sede":
                    $t->setSede($valor);
                    break;
                case "direccion":
                    $t->setDireccion($valor);
                    break;
                case "valorbeca":
                    $t->setValorbeca($valor);
                    break;
                case "vigenciainicia":
                    if (isset($valor) && strlen($valor) > 0) {
                        var_dump($valor);
                        die();
                        $t->setVigenciainicia($valor);
                    } else {
                        //$t->setVigenciainicia(NULL);
                    }
                    break;
                case "jornada":
                    $t->setJornada($valor);
                    break;
                case "vigencia":
                    $t->setVigencia($valor);
                    break;
                case "mocodmotiv":
                    $t->setMocodmotiv($valor);
                    break;
                case "observacion":
                    $t->setObservacion($valor);
                    break;
                case "esafiliado":
                    $t->setEsafiliado($valor);
                    break;
                case "esafiliado":
                case "fechaevaluacion":    //No se inicializa por formulario
                    break;
                case "fechapostulacion":    //No se inicializa por formulario
                    break;
                case "institucion":
                    break;
                case "idinstitucion":

                    $em = $this->getDoctrine()->getManager();

                    $institucion = $em->getRepository(Institucion::class)
                        ->find($valor);

                    $t->setInstitucion($institucion);
                    break;
                case "documentospresentados":
                    break;
                case "envioinvitacion":
                    $t->setEnvioinvitacion($valor);
                    break;
                case "consecutivo":
                    break;
                case "idtipobeca":
                    break;
                default:
                    throw new \Exception("El campo " . $k . " no esta definido en becado");
            }
        }

        return $t;
    }

