    /**
     * Registra un proceso judicial
     *
     * @Route("/registrarService", name="becado_registrarservice")
     */
    public function registrarServiceAction(Request $request)
    {
        $em = $this->getDoctrine()->getManager();
        $json = $request->get('json');
        $helpers = $this->get("app.helpers");


        if ($json == null) {
            return $helpers->json(new JsonResponse(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "El JSON es null"
            )));
        }

        $params = json_decode($json);

        if (isset($params->id)) {
            if (strlen($params->id) > 0) {
                $esnuevo = FALSE;
                $t = $this->findbyId($em, $params->id);
            } else {
                $esnuevo = TRUE;
                $t = new Becado();
                $t->setValorbeca(0);
                $t->setVigencia(Parametros::YEAR);
                $t->setConsecutivo($this->contar($em) + 1);
                $t->setIdtipobeca('N');
            }
        } else {
            $esnuevo = TRUE;
            $t = new Becado();
            $t->setValorbeca(0);
            $t->setVigencia(Parametros::YEAR);
            $t->setConsecutivo($this->contar($em) + 1);
            $t->setIdtipobeca('N');
        }

        $t->setEnvioinvitacion(0);
        try {
            $t = $this->inicializarEntidadDesdeJSON($json, $t);
        } catch (\Exception $ex) {
            return $helpers->json(new JsonResponse(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "Error inicializando: " . $ex->getMessage()
            )));
        }
        $t->setFechapostulacion(new DateTime('now'));
        try {
            $em->persist($t);
            $em->flush();

            return $helpers->json(new JsonResponse(array(
                "status" => "Ok",
                "code" => "200",
                "msg" => $esnuevo ? "Becado registrado" : "Becado registrado"
            )));
        } catch (\Exception $ex) {
            return $helpers->json(new JsonResponse(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "Error creado becado: " . $ex->getMessage()
            )));
        }
    }

