    /**
     * Upload file
     *
     * @Route("/upload/{token}", name="documentobacado_upload")
     */
    public function uploadAction(Request $request, $token)
    {
        $file = $request->files->get('archivo');
        $helpers = $this->get("app.helpers");

        $check = $helpers->authCheck($token, true);

        if ($check == FALSE) {
            return new JsonResponse(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "Token no es valido"
            ));
        }

        $em = $this->getDoctrine()->getManager();

        $response = new Response();
        // $response->headers->set('Content-Type', 'application/json');
        // $response->headers->set('Access-Control-Allow-Origin', '*');

        if ($file == null) {
            return $helpers->json(json_encode([
                "status" => "Falla",
                "code" => "400",
                "msg" => "El archivo es null "
            ]));
        }

        if (empty($file)) { //Se va a cargar un archivo   
            $response->setContent(json_encode([
                "status" => "Error de registro",
                "code" => "400",
                "msg" => "No existe archivo que subir"
            ]));


            return $response;
        }

        try {
            $ext = $file->guessExtension();
        } catch (\Exception $exc) {
            $response->setContent(json_encode([
                "status" => "Error en guessExtension",
                "code" => "400",
                "msg" => "Error registrando " . $exc->getTraceAsString()
            ]));
            return $response;
        }

        if ($ext != 'pdf') {
            $response->setContent(json_encode([
                "status" => "Falla",
                "code" => "202",
                "msg" => "La extension no es correcta, se espera PDF"
            ]));
            return $response;
        }

        try {
            $filename = time() . ".pdf";
            $pathOfFile = "uploads/";
            $file->move($pathOfFile, $filename);
        } catch (\Exception $exc) {
            $response->setContent(json_encode([
                "status" => "Error",
                "code" => "400",
                "msg" => "Error moviendo el archivo a la carpeta " . $exc->getTraceAsString()
            ]));
            return $response;
        }

        $em = $this->getDoctrine()->getManager();

        $d = $em->getRepository(Documentopresentado::class)
            ->find($request->get('id'));

        $d->setPresentado("1");
        $d->setNombre($filename);

        try {
            $em->persist($d);
            $em->flush();
        } catch (\Exception $exc) {
            $response->setContent(json_encode([
                "status" => "Falla",
                "code" => "400",
                "msg" => "Error registrando " . $exc->getTraceAsString()
            ]));
            return $response;
        }

        $response->setContent(json_encode([
            "status" => "Registo exitoso",
            "code" => "200",
            "msg" => "Upload exitoso"
        ]));

        return $response;
    }

