    {
        $em = $this->getDoctrine()->getManager();

        $id = $request->get('id');
        $mocodmotiv = $request->get('mocodmotiv');
        $observacion = $request->get('observacion');
        //    $hash = $request->get('token');

        $helpers = $this->get("app.helpers");

        //    $check = $helpers->authCheck($hash, true);

        if ($id == null) {
            return $helpers->json(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "El Id es null"
            ));
        }

        $postulado = $this->findbyId($em, $id);

        $postulado = $em->getRepository(becado::class)
            ->find($id);

        if (!$postulado) {
            return $helpers->json(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "El Id es null"
            ));
        }

        $postulado->setMocodmotiv($mocodmotiv);
        $postulado->setObservacion($observacion);

        try {
            $em->persist($postulado);
            $em->flush();

            // $this->enviarCorreoRevisionDocumentos($postulado);

            return $helpers->json(array(
                "status" => "Ok",
                "code" => "200",
                "msg" => "Registro de evaluación exitosa: "
            ));
        } catch (\Exception $ex) {
            return $helpers->json(array(
                "status" => "Error",
                "code" => "202",
                "msg" => "Error registrando la evaluación: " . $ex->getMessage()
            ));
        }
