    /**
     * Lists all documento entities.
     *
     * @Route("/download/{id}", name="download_findallservice")
     */
    public function downloadAction($id)
    {
        $helpers = $this->get("app.helpers");
        $em = $this->getDoctrine();
        $repository = $em->getRepository(Documentopresentado::class);

        $d = $repository->find($id);

        if (!is_object($d)) {
            return new Response('Sin documento');
        }

        try {
            $dir  = __DIR__ . "/../../public/uploads/";
            //$file_with_path = $this->container->getParameter ( 'file_directory' ) . "/" . $fileName;
            $response = new BinaryFileResponse($dir . $d->getNombre());
            $response->headers->set('Content-Type', 'text/plain');
            $response->setContentDisposition(ResponseHeaderBag::DISPOSITION_ATTACHMENT, $d->getNombre());
            return $response;
        } catch (\Exception $e) {
            $array = array(
                'status' => 0,
                'message' => 'Download error'
            );
            $response = new JsonResponse($array, "400");
            return $response;
        }
    }

