            $headers = $message->getHeaders();
            $headers->addTextHeader('Disposition-Notification-to', "premiobachiller@comfamiliar.com");

            $result = $mailer->send($message);
            return $result;
        } catch (\Throwable $ex) {
        }
        return NULL;
    }

