    public function enviarcorreomasivoinvitacion()
    {
        $helpers = $this->get("app.helpers");
        $em = $this->getDoctrine()->getManager();
        $contador = 0;
        $l = $em->getRepository(Becado::class)
            ->findBy(["vigencia" => Parametros::YEAR]);

        foreach ($l as $t) {
            if (filter_var($t->getCorreoelectronico(), FILTER_VALIDATE_EMAIL)) {
            } else {
                echo ("No es válido correo del postulado " . $t->getCorreoelectronico() . "-<br />");
                $contador++;
            }
        }

        if ($contador > 0) {
            return $helpers->json(array(
                "status" => "Ok",
                "code" => "202",
                "msg" => "Existen correos inválidos" . $contador
            ));
        }

        $contador = 0;
        $prueba = true;
        foreach ($l as $t) {
            $this->enviarCorreoInvitacionPremiacion($em, $t, $prueba);
            $contador++;
        }

        $em->flush();

        return $helpers->json(array(
            "status" => "Ok",
            "code" => "200",
            "msg" => "Correos enviados " . $contador
        ));
    }

