    /**
     * @Route("/estadisticagenero/{vigencia}", name="becado_estadisticagenero")
     */
    public function generarEstadisticagenero($vigencia)
    {
        $helpers = $this->get("app.helpers");

        $em = $this->getDoctrine()->getManager();
        $repository = $em->getRepository(Becado::class);

        $contadorMasculino = $repository->createQueryBuilder('u')
            ->select('count(u.id)')
            ->where('u.genero = 1', 'u.vigencia = ' . $vigencia)
            ->getQuery()
            ->getSingleScalarResult();

        $contadorFemenino = $repository->createQueryBuilder('u')
            ->select('count(u.id)')
            ->where('u.genero = 2', 'u.vigencia = ' . $vigencia)
            ->getQuery()
            ->getSingleScalarResult();

        $l['M'] = $contadorMasculino;
        $l['F'] = $contadorFemenino;

        return $helpers->json($l);
    }

    /**
     * @Route("/estadisticaafiliacion/{vigencia}", name="becado_estadisticaafiliacion")
     */
    public function generarEstadisticaafiliado($vigencia)
    {
        $helpers = $this->get("app.helpers");

        $em = $this->getDoctrine()->getManager();
        $repository = $em->getRepository(Becado::class);

        $contadorAfiliado = $repository->createQueryBuilder('u')
            ->select('count(u.id)')
            ->where('u.esafiliado = :esafiliado', 'u.vigencia = ' . $vigencia)
            ->setParameter('esafiliado', 'S')
            ->getQuery()
            ->getSingleScalarResult();

        $contadorNoafiliado = $repository->createQueryBuilder('u')
            ->select('count(u.id)')
            ->where('u.esafiliado = :esafiliado', 'u.vigencia = ' . $vigencia)
            ->setParameter('esafiliado', 'N')
            ->getQuery()
            ->getSingleScalarResult();

        $l['A'] = $contadorAfiliado;
        $l['N'] = $contadorNoafiliado;

        return $helpers->json($l);
    }

    /**
     * @Route("/estadisticamunicipio/{vigencia}", name="becado_estadisticamunicipio")
     */
    public function generarEstadisticamunicipio($vigencia)
    {
        $helpers = $this->get("app.helpers");

        $em = $this->getDoctrine()->getManager();
        $repository = $em->getRepository(Becado::class);

        $qb = $em->createQueryBuilder();

        $qb->select(array('c.nombre as ciudad', 'count(u) as cantidad'))
            ->from('App\Entity\Becado', 'u')
            ->where('u.vigencia = ' . $vigencia)
            ->join('u.institucion', 'i')
            ->join('i.ciudad', 'c')
            ->groupBy('c.nombre');

        $l = $qb->getQuery()
            ->getResult();

        return $helpers->json($l);
    }

    /**
     * @Route("/estadisticaciudadinstitucion/{vigencia}", name="becado_estadisticaciudadinstitucion")
     */
    public function generarEstadisticaciudadinstitucion($vigencia)
    {
        $helpers = $this->get("app.helpers");

        $em = $this->getDoctrine()->getManager();

        $l = $em->getRepository(Ciudad::class)
            ->findAll();

        $informes = array();
        foreach ($l as $ciudad) {

            $qb = $em->createQueryBuilder();

            $qb->select('i')
                ->from('App\Entity\Institucion', 'i')
                ->join('i.ciudad', 'c')
                ->where('c.codigo = :codigo')
                ->setParameter('codigo', $ciudad->getCodigo());

            $is = $qb->getQuery()
                ->getResult();

            $instituciones = array();

            foreach ($is as $institucion) {
                $qbb = $em->createQueryBuilder();

                //        array_push($instituciones, 
                //        $ciudades["$ciudad->getNombre()"]

                $qbb->select('count(t.id)')
                    ->from('App\Entity\Becado', 't')
                    ->join('t.institucion', 'i')
                    ->where('i.id = :id', 't.vigencia = ' . $vigencia)
                    ->setParameter('id', $institucion->getId());

                $cantidadpostulados = $qbb->getQuery()
                    ->getSingleScalarResult();

                $institucionInforme = [
                    "nombreinstitucion" => $institucion->getNombreinstitucion(),
                    "telefono" => $institucion->getTelfijo(),
                    "cantidadpostulados" => $cantidadpostulados
                ];
                array_push($instituciones, $institucionInforme);
            }
            $ciudadInforme = [
                "ciudad" => $ciudad->getNombre(),
                "institucions" => $instituciones
            ];

            array_push($informes, $ciudadInforme);
        }
        return $helpers->json($informes);
    }
